import React, { useState } from 'react';
import './styles.css';

const Holon = ({ node, onSelect, onAdd, onRemove, isSelected }) => {
  const { name, children } = node;

  // Simplified click handler for selection
  const handleSelect = (e, node) => {
    e.stopPropagation();
    onSelect(node);
  };

  return (
    <div className={`holon ${isSelected ? 'selected' : ''}`} onClick={(e) => handleSelect(e, node)}>
      <div className="name">{name}</div>
      <div className="buttons">
        <button className="add-button" onClick={(e) => { e.stopPropagation(); onAdd(node); }}>+</button>
        {children.length === 0 && <button className="remove-button" onClick={(e) => { e.stopPropagation(); onRemove(node.id); }}>x</button>}
      </div>
      {children.length > 0 && (
        <div className="children">
          {children.map((child) => (
            <Holon key={child.id} node={child} onSelect={onSelect} onAdd={onAdd} onRemove={onRemove} isSelected={isSelected?.id === child.id} />
          ))}
        </div>
      )}
    </div>
  );
};

const App = () => {
  const [nodes, setNodes] = useState([
    {
      id: 'root',
      name: 'Information System',
      description: 'An Information System is a set of components for collecting, storing, and processing data.',
      children: [
        {
          id: 'stakeholder',
          name: 'Stakeholder',
          description: 'A stakeholder refers to any individual, group, or organization that has an interest or concern in the system, its development, implementation, or outcomes. These stakeholders can be internal or external to the organization implementing the information system. Understanding and managing stakeholders is crucial for the success of an information system project.',
          children: [],
        },
        {
          id: 'infrastructure',
          name: 'Infrastructure',
          description: 'Infrastructure is the foundation or framework that supports a system or organization.',
          children: [],
        }
      ],
    }
  ]);
  const [selectedHolon, setSelectedHolon] = useState(null);
  const [idCounter, setIdCounter] = useState(3);

  const selectHolon = (node) => {
    setSelectedHolon(node);
  };

  const addChild = (parentNode) => {
    const childName = prompt('Enter the name of the child:');
    if (!childName || childName.trim() === '') {
      alert('Please enter a valid name for the child.');
      return;
    }

    const newId = `node-${idCounter}`;
    setIdCounter(idCounter + 1);

    const addNodeRecursively = (nodes, parentId, childName, newId) => {
      return nodes.map(node => {
        if (node.id === parentId) {
          const newNode = {
            id: newId,
            name: childName,
            description: '',
            children: []
          };
          return { ...node, children: [...node.children, newNode] };
        } else if (node.children.length) {
          return { ...node, children: addNodeRecursively(node.children, parentId, childName, newId) };
        }
        return node;
      });
    };

    setNodes(prevNodes => addNodeRecursively(prevNodes, parentNode.id, childName, newId));
  };

  const removeChild = (nodeId) => {
    const removeNodeRecursively = (nodes, nodeId) => {
      return nodes.reduce((acc, node) => {
        if (node.id !== nodeId) {
          const filteredChildren = removeNodeRecursively(node.children, nodeId);
          acc.push({ ...node, children: filteredChildren });
          return acc;
        }
        return acc;
      }, []);
    };

    setNodes(prevNodes => removeNodeRecursively(prevNodes, nodeId));
  };

  return (
    <div className="app-container">
      <div className="holons-container">
        <Holon key={nodes[0].id} node={nodes[0]} onSelect={selectHolon} onAdd={addChild} onRemove={removeChild} isSelected={selectedHolon?.id === nodes[0].id} />
      </div>
      <div className="holon-details">
        {selectedHolon ? (
          <>
            <h2>Holon Details</h2>
            <p>Name: {selectedHolon.name}</p>
            <p>Description: {selectedHolon.description || "No description provided."}</p>
          </>
        ) : (
          <p>Select a holon to see details.</p>
        )}
      </div>
    </div>
  );
};

export default App;
